import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f05d3ed8.js";const o={},c=t("<p>《三命通会》卷 八·六乙日辛巳时断</p><p>六乙日生时辛巳，金木交争主不仁；</p><p>有化月中身旺贵，不通无化恐伤人。</p><p>乙日辛巳时，暗金交争，是非日有，若通身旺月，有倚托，化鬼为官，行身旺运，贵。</p><p>通木气月，行金旺运，大贵。</p><p>通金气月，行身旺运，亦贵。</p><p>乙丑日辛巳时，先杂后纯，生寅午丙丁年月，偏官有制，作高命看。</p><p>巳申酉丑月，官煞重叠，多带疾从煞，亦吉。</p><p>惟身强主兵权，有名誉。</p><p>乙卯日辛巳时，春生，身强煞浅，大贵。</p><p>夏平常。</p><p>秋，官煞旺；冬，印绶旺，俱吉。</p><p>秋不如冬。</p><p>乙巳日辛巳时，克妻，妻子俱晚。</p><p>若巳酉丑月，木柔金重，主带疾。</p><p>不然寿促。</p><p>甲巳子巳年月，入偏官格，西运，风宪。</p><p>春月身旺，更吉。</p><p>乙未日辛巳时，午月干强，武职，有名誉。</p><p>亥子印绶，吉。</p><p>乙酉日辛巳时，若未月生，身坐制伏则吉。</p><p>秋偏官，贵。</p><p>酉月，行南方运，贫，不然残疾。</p><p>乙亥日辛巳时，生巳午月，偏官有制。</p><p>春干强，位居风宪。</p><p>秋煞重，主残疾。</p><p>乙巳相伤逢金木，求名求利常反复；六亲骨肉有如无，印绶运乡能发福。</p><p>乙日时逢辛巳，柱中鬼旺身衰。</p><p>六亲难靠不和谐，谋望有成有败。</p><p>几度遇凶则吉，信知苦尽甘来。</p><p>运行身旺印绶怀，富贵时人喝采。</p>",31),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","185卷 八·六乙日辛巳时断.html.vue"]]);export{f as default};
